import {Link} from "react-router-dom";

function Hamburger() {
    return(
        <>
            <div className="hamburger">
                    <ul>
                        <li><Link to="/summary" id="homeNav" className="burger burger1">SUMMARY</Link></li>
                        <li><Link to="/live" id="liveNav" className="burger burger2">LIVE</Link></li>
                        <li><Link to="/give" id="giveNav" className="burger burger3">GIVE</Link></li>
                        <li><Link to="/grow" id="growNav" className="burger burger4">GROW</Link></li>
                        <li><Link to="/owe" id="oweNav" className="burger burger5">OWE</Link></li>
                        <li><Link to="/about" id="homeNav" className="burger burger6">ABOUT</Link></li>
                    </ul>
            </div>

            <style jsx>{`
                .hamburger {
                    display: none
                }

                @media (max-width: 700px){

                    .hamburger{
                        padding-top: 10px;
                        margin-left: 10px;
                        display: fixed;
                        z-index: 10;
                    }
                }

                .burger {
                    width: 1.5rem;
                    height: 0.25rem;
                    border-radius: 10px;
                    transform-origin: 1px;
                    transition: all 0.3s linear;
                }

                .burger1{
                    transform: ${ isOpen ? 'rotate(45deg)' : 'rotate(0)'};
                }
                .burger2{
                    transform: ${ isOpen ? 'translateX(100%)' : 'translateX(0)'};
                    opacity: ${ isOpen ? 0 : 1};
                }
                .burger3{
                    transform: ${ isOpen ? 'rotate(-45deg)' : 'rotate(0)'};
                }.burger1{
                    transform: ${ isOpen ? 'rotate(45deg)' : 'rotate(0)'};
                }
                .burger2{
                    transform: ${ isOpen ? 'translateX(100%)' : 'translateX(0)'};
                    opacity: ${ isOpen ? 0 : 1};
                }
                .burger3{
                    transform: ${ isOpen ? 'rotate(-45deg)' : 'rotate(0)'};
                }

            `}</style>

        </>
    )
}
export default Hamburger;
